import { Button } from 'reactstrap'
import Layout from '../components/layout'
import Particles from 'react-particles-js'

const particleOpt = {
  particles: {
    number: {
      value: 150,
      density: {
        enable: true,
        value_area: 800
      },
      move: {
        enable: true,
        speed: 1
      }
    }
  },
  interactivity: {
    events: {
        onhover: {
            enable: true,
            mode: ["push"]
        }
    }
  }
}

function Index(props) {
    return (
      <div>
        <Particles canvasClassName="particle-canvas" params={particleOpt} />
        <Layout>
          <div className="wrapper">
            <div className="introduction">
              <h1 className="display-3 text-center hello">Hello, I'm <span>Maicon Esteves</span>.</h1>
              <h2 className="display-3 text-center hello">I'm a full-stack developer.</h2>
              <Button outline color="secondary">Learn More</Button>
            </div>
          </div>
        </Layout>
        <style jsx>{`
        body{
          background-color: #080708;
          height: 100%;
          min-height: 100%;
        }
        `}</style>  
      </div>
    );
}

export default Index
